Begin SWE_SandReDoorNotOwned

if ( GetDisabled == 0 )
	if ( SWE_SandReManorGlobal == 1 )
		Disable
	endif
endif

if ( GetDisabled == 1 )
	if ( SWE_SandReManorGlobal == 0 )
		Enable
	endif
endif

if ( OnActivate == 1 )
PlaySound "LockedDoor"
Return
endif

End

Begin SWE_SandReDoorOWNEDSCR

if ( GetDisabled == 0 )
	if ( SWE_SandReManorGlobal == 0 )
		Disable
	endif
endif

if ( GetDisabled == 1 )
	if ( SWE_SandReManorGlobal== 1 )
		Enable
	endif
endif

End
